import React, {Component} from "react";
import {connect} from "react-redux";
import {userLogIn} from '../actions/test.action'
import iniModel from '../models/redux.state.ini';

class Page extends Component {
    static getInitialProps({store, isServer, pathname, query}) {
        
        store.dispatch({type: "FOO", payload: "foo"}); // component will be able to read from store's state when rendered
        return { custom: "custom", state: iniModel }; // you can pass some custom props to component from here
    }

    componentDidMount() {
        console.log(this.props);

        setTimeout(() => {
            console.log(this.props)
        }, 6000)
    }

    render() {
        return (
            <div>
                <div>Prop from getInitialProps {this.props.custom}</div>
                <button onClick={() => this.props.fuckThis()}>test dispatching</button>
            </div>
        );
    }
}

const mapStateToProps = state => {
    return {
        state,
    };
};

const mapDispatchToProps = dispatch => {
    return {
        fuckThis: (payload) => dispatch(userLogIn(payload))
    };
};
export default connect(null, mapDispatchToProps)(Page);
